import React from 'react';
import './Results.css';

const CALENDLY_URL = process.env.REACT_APP_CALENDLY_URL || 'https://calendly.com/your-link';

function Results({ data, onReset }) {
  const { seo, ia, orientation, robotsTxt } = data;

  const getOrientationText = () => {
    switch (orientation) {
      case 'IA':
        return 'Votre site est mieux préparé pour la visibilité IA. Les moteurs conversationnels pourront mieux comprendre et citer votre contenu.';
      case 'SEO':
        return 'Votre site est mieux préparé pour la visibilité SEO traditionnelle. Les moteurs de recherche classiques pourront mieux explorer et classer vos pages.';
      case 'HYBRIDE':
        return 'Votre site présente un équilibre entre préparation SEO et IA. Une approche hybride est recommandée pour maximiser votre visibilité.';
      default:
        return '';
    }
  };

  const getScoreColor = (score) => {
    if (score >= 70) return '#4CAF50';
    if (score >= 50) return '#C9AD01';
    return '#FF6B6B';
  };

  const getInterpretation = (score) => {
    if (score >= 80) return 'Excellent : Votre site est très bien préparé.';
    if (score >= 60) return 'Bon : Votre site est bien préparé avec quelques axes d\'amélioration.';
    if (score >= 40) return 'Moyen : Votre site nécessite des améliorations significatives.';
    return 'Faible : Votre site nécessite une refonte importante.';
  };

  return (
    <div className="results-container">
      <div className="results-header">
        <h2 className="results-title">Résultats de l'analyse</h2>
        <button onClick={onReset} className="reset-button">
          Nouvelle analyse
        </button>
      </div>

      <div className="results-grid">
        {seo && (
          <div className="score-card">
            <div className="score-header">
              <h3 className="score-label">Score SEO</h3>
              <div className="score-value" style={{ color: getScoreColor(seo.score) }}>
                {seo.score}/{seo.maxPossibleScore || 100}
              </div>
            </div>
            {seo.note && (
              <p className="score-note" style={{ fontSize: '0.85rem', color: '#999', fontStyle: 'italic', marginTop: '5px' }}>
                {seo.note}
              </p>
            )}
            <p className="score-interpretation">{getInterpretation(seo.score)}</p>

            <div className="score-details">
              <h4 className="details-title">Détail par axe</h4>
              {seo.details && (
                <div className="details-list">
                  {Object.entries(seo.details).map(([key, value]) => (
                    <div key={key} className="detail-item">
                      <span className="detail-label">{key}:</span>
                      <span className="detail-score">{value.score || 0} points</span>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        )}

        {ia && (
          <div className="score-card">
            <div className="score-header">
              <h3 className="score-label">Score IA</h3>
              <div className="score-value" style={{ color: getScoreColor(ia.score) }}>
                {ia.score}/{ia.maxPossibleScore || 100}
              </div>
            </div>
            {ia.note && (
              <p className="score-note" style={{ fontSize: '0.85rem', color: '#999', fontStyle: 'italic', marginTop: '5px' }}>
                {ia.note}
              </p>
            )}
            <p className="score-interpretation">{getInterpretation(ia.score)}</p>

            <div className="score-details">
              <h4 className="details-title">Détail par axe</h4>
              {ia.details && (
                <div className="details-list">
                  {Object.entries(ia.details).map(([key, value]) => (
                    <div key={key} className="detail-item">
                      <span className="detail-label">{key}:</span>
                      <span className="detail-score">{value.score || 0} points</span>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        )}
      </div>

      {orientation && (
        <div className="orientation-card">
          <h3 className="orientation-title">Orientation stratégique</h3>
          <div className="orientation-badge" data-orientation={orientation}>
            {orientation}
          </div>
          <p className="orientation-text">{getOrientationText()}</p>
        </div>
      )}

      {robotsTxt && (
        <div className="info-card">
          <h3 className="info-title">Informations techniques</h3>
          <div className="info-item">
            <span className="info-label">robots.txt:</span>
            <span className="info-value">
              {robotsTxt.present ? (
                <span style={{ color: '#4CAF50' }}>✅ Présent</span>
              ) : (
                <span style={{ color: '#FF6B6B' }}>❌ Absent</span>
              )}
            </span>
          </div>
          {robotsTxt.present && !robotsTxt.accessible && (
            <p className="info-note" style={{ fontSize: '0.85rem', color: '#999', marginTop: '10px' }}>
              Le fichier robots.txt est présent mais n'est pas accessible.
            </p>
          )}
        </div>
      )}

      <div className="disclaimer">
        <p className="disclaimer-text">
          <strong>Important :</strong> Cet outil ne simule pas ChatGPT ni aucun moteur réel. 
          Il ne garantit ni classement Google, ni citation par une IA. 
          Il mesure uniquement une préparation structurelle et informationnelle. 
          Les résultats doivent être interprétés comme des indicateurs stratégiques, et non comme des prédictions.
        </p>
      </div>

      <div className="cta-section">
        <a
          href={CALENDLY_URL}
          target="_blank"
          rel="noopener noreferrer"
          className="calendly-button"
        >
          Voir comment corriger ces points
        </a>
      </div>
    </div>
  );
}

export default Results;
